import React from 'react';
import ReactDOM from 'react-dom/client'; // Добавьте импорт ReactDOM
import { BrowserRouter, Routes, Route } from 'react-router-dom';
// Используем Routes вместо Switch
import App from './App'; // Путь должен быть правильным
import './styles.css';

// Создаем корень и рендерим компонент
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        {/* Добавьте другие маршруты сюда, если необходимо */}
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
